  definition: entity belonging to a given set
  examples: []
  id: 102-01-03
  language_code: eng
  notes:
  - The notation `x` ∈ `A` expresses that the entity `x` is an element of the set
    `A`. The notation `x` ∉ `A` expresses that the entity `x` is not an element of
    the set `A`. Another wording is "`x` belongs to `A`" or "`x` does not belong to
    `A`".
